def conv_forward_naive(x,weight,b,parameters):

	pad = parameters['pad']
	stride = parameters['stride']

	(m, n_h, n_w, n_C_prev) = (len(x), len(x[0]), len(x[0][0]), len(x[0][0][0]))
	
	(f,f, n_C_prev, n_C) = (len(weight), len(weight[0]), len(weight[0][0]), len(weight[0][0][0]))

	n_H = int(1 + (n_h + 2 * pad - f) / stride)
	n_W = int(1 + (n_w + 2 * pad - f) / stride)

	samples, x_width, y_height, channels = (len(x), len(x[0]), len(x[0][0]), len(x[0][0][0]))
	x_prev_pad = [[[[0 for _ in range(channels)] for _ in range(y_height + 2*pad)] for _ in range(x_width + 2*pad)] for _ in range(samples)]

	# Padding operation (expensive but fine when i is small)
	for i in range(samples):
		for j in range(x_width):
			for k in range(y_height):
				for l in range(channels):
					x_prev_pad[i][j + 1][k + 1][l] = x[i][j][k][l]

	Z = [[[[0 for _ in range(n_C)] for _ in range(n_W)] for _ in range(n_H)] for _ in range(m)]

	caches = (x,weight,b,pad,stride)
	
	# Convolution operation (expensive but fine when i is small) 
	for i in range(m):
		for h in range(n_H):
			for w in range(n_W):
				for c in range(n_C):

						vert_start = h*stride
						vert_end = vert_start + f
						horiz_start = w * stride
						horiz_end = horiz_start + f

						for x in range(f):
							for y in range(f):
								for j in range(len(x_prev_pad[0][0][0])):
									Z[i][h][w][c] += x_prev_pad[i][vert_start + x][horiz_start + y][j] * weight[x][y][j][c]

						# Add bias term 
						Z[i][h][w][c] += b[c]
	return Z

def batchnorm_forward(x, running_mu, running_sigma):

	m,h,w,c = (len(x), len(x[0]), len(x[0][0]), len(x[0][0][0]))
	mu = [[[running_mu]]]
	sigma = [[[running_sigma]]]

	for i in range(m):
		for j in range(h):
			for k in range(w):
				for l in range(c):
					x[i][j][k][l] = (x[i][j][k][l] - mu[0][0][0][l])/math.sqrt(sigma[0][0][0][l] + 1e-8)

	return x

def relu(x):
	for i in range(len(x)):
		for j in range(len(x[0])):
			for k in range(len(x[0][0])):
				for l in range(len(x[0][0][0])):
					x[i][j][k][l] = max(0, x[i][j][k][l])
	return x

def max_pooling(prev_layer, filter_size=2):

	(m, n_H_prev, n_W_prev, channels) = (len(prev_layer),len(prev_layer[0]), len(prev_layer[0][0]), len(prev_layer[0][0][0]))

	stride = 2

	# with max pooling I dont want overlapping filters so make stride = filter size
	n_H = int((n_H_prev - filter_size)/filter_size + 1)
	n_W = int((n_W_prev - filter_size)/filter_size + 1)

	pooling = [[[[0 for _ in range(channels)] for _ in range(n_W)] for _ in range(n_H)] for _ in range(m)]

	for i in range(m):
		for h in range(n_H):
			for w in range(n_W):
				for c in range(channels):

					vert_start = h*filter_size
					vert_end = vert_start + filter_size
					horiz_start = w*filter_size
					horiz_end = horiz_start + filter_size
									
					for x in range(filter_size):
						for y in range(filter_size):
							pooling[i][h][w][c] = max(pooling[i][h][w][c], prev_layer[i][vert_start + x][horiz_start + y][c])
		
	return pooling

def fully_connected(prev_layer, w,b):

	output = [[0 for i in range(10)] for j in range(len(prev_layer))]

	for row in range(len(prev_layer)):
		for col in range(10):
			for entry in range(len(prev_layer[0])):
				output[row][col] += prev_layer[row][entry]*w[entry][col]  + b[row]
		
	return output


def softmax(z):
	for i in range(len(z)):
		row_sum = 0
		for j in range(len(z[0])):
			row_sum += math.exp(z[i][j])

		for j in range(len(z[0])):
			z[i][j] = math.exp(z[i][j])/ row_sum
			
	return z

def evaluate(x):

		# Preprocessing step on the input
		(m, n_h, n_w, n_C_prev) = (len(x), len(x[0]), len(x[0][0]), len(x[0][0][0]))
		
		for i in range(m):
			for h in range(n_h):
				for w in range(n_w):
					for c in range(n_C_prev):
						x[i][h][w][c] = x[i][h][w][c] - 0.43326861213235296

		# Forward pass of the model 
		Z1 = conv_forward_naive(x,W1,B1,{'pad':1,'stride':1})
		BN1 = batchnorm_forward(Z1, running_mu_1, running_sigma_1)
		A1 = relu(BN1)
		Pool1 = max_pooling(A1,2)
		Z2 = conv_forward_naive(Pool1,W2,B2,{'pad':1,'stride':1})
		BN2 = batchnorm_forward(Z2, running_mu_2, running_sigma_2)
		A2 = relu(BN2)
		Pool2 = max_pooling(A2,2)
		Z3 = conv_forward_naive(Pool2,W3,B3,{'pad':1,'stride':1})
		BN3 = batchnorm_forward(Z3, running_mu_3, running_sigma_3)
		A3 = relu(BN3)
		Pool3 = max_pooling(A3,2)

		# This needs to be in numpy code
		(a0, a1, a2, a3) = (len(Pool3), len(Pool3[0]), len(Pool3[0][0]), len(Pool3[0][0][0]))
		pool3_reshape = [[] for _ in range(a0)]

		for i in range(a0):
			for j in range(a1):
				for k in range(a2):
					for l in range(a3):
						pool3_reshape[i].append(Pool3[i][j][k][l]) 

		Z4 = fully_connected(pool3_reshape, W4, B4)

		A4 = softmax(Z4)

		return A4

# Allows the model to consume the queue of images
async def on_queue(batch, env, ctx):

	for message in batch.messages:
		image = json.loads(message.body.image)
		# Store the output in workers KV
		await env.AIMICRO.put(str(message.body.UUID), str(evaluate([image])))

